import React from 'react';
import { connect } from 'react-redux'

class Years extends React.Component {
    constructor() {
        super();
        this
    }
    render() {
        return (
            <div>
                {this.props.years.years.reverse().map(year => (
                    <option className="option" onClick={this.props.handleYearChange} value={year.name} key={year.id}> {year.name} </option>
                ))}
            </div>
        )
    }
}

export default connect(state => state)(Years);
